window.bookSummaryJSON = "<p><b>She's an awkward bookworm. He's a fictional character in her favorite book.</b><br> <br> When Barbara “Barbi” Bancroft mysteriously receives an unreleased manuscript from her favorite book series, she can’t curb her excitement. But when she gets sucked into the story—literally—she finds herself in the fantastical realm of Akkaya. Immediately, she thinks this is the adventure of a lifetime and she will finally meet her Prince Charming, and maybe have her first kiss.</p> <p>But things don’t go her way, and soon she is running for her life.</p> <p>Her only hope to survive and get home is the heroic Sir Damien, her fictional crush.</p> <p>Unfortunately, he is anything but heroic and he decides to sacrifice her in an evil ritual that will allow him to invade her world—and conquer it.</p> <p>Channeling her main character energy, Barbi tries to run and outsmart Sir Damien. And that is how she ends up thrown in a dungeon, waiting for her death.</p> <p>With the villain of the story.</p> <p>Forming an unlikely alliance with the most hated character wasn’t in Barbi’s bingo card, but she will do anything to save herself and her world.</p> <p>Things become further complicated when she accidentally gets mated to said villain, and now she’s trapped forever.</p> <p>Or is she?<br> <br> This is a <b>DARK</b> fantasy romance with a villainous love interest. Please check the triggers before listening.</p>"; 
